import * as C from './LandingStyling';
import { Link } from 'react-router-dom';

export default function Landing() {
    return (
        <C.container>
            <C.hero>
                <Link to={'/play'}><C.button>Get Started</C.button></Link>
            </C.hero>
        </C.container>
    );
}
